INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("リン", 1, 10040, 0, 0.0, 24, 102601, "2030/12/17 14:59:59", 0.0, 1, "あたしだって\nやるときはやるよ！", "2020/04/30 12:00:00", 24001, 0.0);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("リン", 1, 10040, 1, 0.0, 24, 102601, "2030/12/17 14:59:59", 0.0, 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", "2020/04/30 12:00:00", 24002, 0.0);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("リン", 1, 10040, 2, 0.0, 24, 102601, "2030/12/17 14:59:59", 0.0, 1, "終わった終わった\n一人でもなんとか\nなるもんだね", "2020/04/30 12:00:00", 24003, 0.0);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("リン", 2, 10040, 3, 0.0, 24, 102601, "2030/12/17 14:59:59", 0.0, 2, "やったね！\nこれでようやく\nサボれるよ…", "2020/04/30 12:00:00", 24004, 0.0);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("リン", 1, 10040, 4, 0.0, 24, 102601, "2030/12/17 14:59:59", 0.0, 1, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", "2020/04/30 12:00:00", 24005, 0.0);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("リン", 2, 10040, 5, 0.0, 24, 102601, "2030/12/17 14:59:59", 0.0, 2, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", "2020/04/30 12:00:00", 24006, 0.0);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("リン", 2, 10040, 6, 0.0, 24, 102601, "2030/12/17 14:59:59", 0.0, 2, "あたしも意外と\nやるもんでしょ？", "2020/04/30 12:00:00", 24007, 0.0);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("リン", 4, 10040, 7, 0.0, 24, 102601, "2030/12/17 14:59:59", 0.0, 4, "疲れた…\nねずみの逃げ足\n速すぎるよ…", "2020/04/30 12:00:00", 24008, 0.0);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("リン", 4, 10040, 8, 0.0, 24, 102601, "2030/12/17 14:59:59", 0.0, 4, "このままじゃ\nまっひ～に\n叱られちゃうよ", "2020/04/30 12:00:00", 24009, 0.0);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("リン", 4, 10040, 9, 0.0, 24, 102601, "2030/12/17 14:59:59", 0.0, 4, "まじめに\nやったんだけどな…\n悔しいな～", "2020/04/30 12:00:00", 24010, 0.0);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("リン", 4, 10040, 10, 0.0, 24, 102601, "2030/12/17 14:59:59", 0.0, 4, "やられた…\nねずみって意外と\nてごわいね", "2020/04/30 12:00:00", 24011, 0.0);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("リン", 4, 10040, 11, 0.0, 24, 102601, "2030/12/17 14:59:59", 0.0, 4, "おのれ～\nあたしのチーズを\n盗みやがって～！", "2020/04/30 12:00:00", 24012, 0.0);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("リン", 1, 10040, 12, 0.0, 24, 102601, "2030/12/17 14:59:59", 0.0, 4, "疲れた…\nけど、次こそは\n守り抜くよ…", "2020/04/30 12:00:00", 24013, 1.81);
